import Body from "./Variants/Body";
import BodyBold from "./Variants/BodyBold";
import Small from "./Variants/Small";
import Huge from "./Variants/Huge";
import TitleH1 from "./Variants/TitleH1";
import TitleH2 from "./Variants/TitleH2";
import TitleH3 from "./Variants/TitleH3";
import TitleH4 from "./Variants/TitleH4";
import TitleH5 from "./Variants/TitleH5";

export default {
  Body,
  BodyBold,
  Small,
  Huge,
  TitleH1,
  TitleH2,
  TitleH3,
  TitleH4,
  TitleH5,
};
